import React from "react";
import api from "./api";
import axios from "axios";

renderPosts = async() => {
    try {
      let res = await axios.get('/posts');
      let posts = res.data;
      // this will re render the view with new data
      this.setState({
        Posts: posts.map((post, i) => (
          <li key={i} className="list-group-item">{post.text}</li>
        ))
      });
    } catch (err) {
      console.log(err);
    }
  }

export default test;
